import React from 'react';
import react from 'assets/images/reactlogo.svg';
import { Cinematic } from './Cinematic';
import { Menu } from './Menu';
;

export const Intro = () => {
  return (
    <div className="color-change-2x">
      <Menu />
      <Cinematic />
      <div id="paperPlane" >
        <img alt='plane' src={react} height="auto" />
      </div>
    </div>
  )
}
